(11, 'Death Stranding llega con un ligero retraso', 'Nuevos retrasos en el videojuego de Kojima', 'Gaming,PS4,Kojima', , 'El prÃ³ximo y muy esperado lanzamiento de Kojima Productions, Death Stranding, lleva aÃ±os rodeado de misterio. Sin embargo, una entrevista del creador, Hideo Kojima, publicada por J-Wave, nos ofrece una actualizaciÃ³n sobre el estado del desarrollo. <br><br>\r\n\r\nEn la entrevista, Kojima confirmÃ³ que se trata de un juego de mundo abierto, algo sobre lo que se llevaba especulando un tiempo. AdemÃ¡s, ha hablado sobre cÃ³mo trabaja el equipo, y sobre la fecha de lanzamiento.<br><br>\r\n\r\nEl creador del videojuego ha asegurado que la historia ya estÃ¡ completa de principio a fin, pero como es un mundo abierto, todavÃ­a queda mucho que pulir. Dice que juega todos los dÃ­as a Death Stranding y va informando al equipo de los pequeÃ±os cambios y modificaciones que tienen que hacer. De esta forma, el equipo se va ajustando al proceso de trabajo.<br><br>\r\n\r\nOtra de las novedades, aunque sigamos sin saber la fecha de lanzamiento, es que por lo visto, llevan retraso con respecto a sus planes originales. No obstante, Kojima informa de que no es una demora muy grande. Como no sabemos cuando saldrÃ¡, tampoco podemos entristecernos demasiado. Al menos, tenemos el consuelo de que estÃ¡n trabajando en ello, por lo que no es un proyecto olvidado.<br><br>\r\n\r\nEs mÃ¡s, Kojima ha comentado que trabajar con una fecha lÃ­mite le ayuda a establecer sus prioridades. Aunque le gustarÃ­a poder dedicarse a todos los detalles hasta estar completamente satisfecho, sabe que contar con un plazo establecido lo hace trabajar con un objetivo claro.<br><br>\r\n\r\nDeath Stranding cuenta con todo un equipo de profesionales en su historia. Inicialmente, Norman Reedus (mÃ¡s conocido como Daryl en The Walking Dead) iba a ser el protagonista de Silent Hills. Sin embargo, cuando el proyecto se cancelÃ³, siguiÃ³ trabajando con Kojima y podremos verlo en el nuevo lanzamiento. Otras caras conocidas como Guillermo del Toro (El Laberinto del Fauno, Hellboy) o Mads Mikkelsen (Doctor Strange, Monstruos S. A.) tambiÃ©n forman parte del elenco del juego.', '2019-11-01 23:57:18', 2);
