(15, 'Â¿CÃ³mo es jugar a Overwatch 2?', 'Comparten casi dos horas de gameplay con material PvE y PvP', ' Overwatch 2, Blizzard, BlizzCon 2019', , 'Uno de los principales anuncios que Blizzard ha llevado a la BlizzCon 2019 es Overwatch 2, secuela del popular hero arena de 2016. Durante la ceremonia de apertura del evento hemos podido ver un trÃ¡iler gameplay y una cinemÃ¡tica, pero mÃ¡s tarde los asistentes tuvieron la ocasiÃ³n de probar in situ (y retransmitir) una demo del juego.\r\n<br />\r\n<br />\r\nEl vÃ­deo que recogemos, del youtuber ohnickel, contiene material PvE y PvP de esta entrega. Como puedes comprobar por ti mismo, ambas vertientes comparten muchos aspectos del Overwatch original en tÃ©rminos de mecÃ¡nicas y contenido, solo que mucho mÃ¡s refinado. La interfaz y el diseÃ±o de algunos personajes se han perfilado para OW2, aunque las habilidades de estos se han mantenido intactas.\r\n<br />\r\n<br />\r\nAsÃ­ pues, las novedades de mayor peso residen en la posibilidad de mejorar y personalizar estas habilidades para la modalidad PvE, equiparnos algunos objetos, o la posibilidad de ver secuencias programadas durante las misiones. El PvP es mucho mÃ¡s conservador, pues a fin de cuentas compartirÃ¡ comunidad con Overwatch 1, pero cuenta con el nuevo modo Push.', '2019-11-02 12:30:48', 2);
