(16, 'NFS Heat muestra su ciclo de dÃ­a y noche', 'Nos muestran cÃ³mo se juega con el nuevo tÃ­tulo de velocida', 'NFS, Carreras, PlayStation ', , 'A travÃ©s de PlayStation Underground nos llega una demostraciÃ³n de la jugabilidad de Need for Speed: Heat, el nuevo tÃ­tulo de la saga de velocidad de Electronic Arts donde nos muestran el ciclo de dÃ­a y noche.<br />\r\n<br />\r\nEstamos ante una de las sagas mÃ¡s longevas de la velocidad en el mundo de los videojuegos con mÃ¡s de 25 aÃ±os de trayectoria y capaz de acumular mÃ¡s 150 millones de unidades. Cuando se anunciÃ³ su vuelta tras el pequeÃ±o traspiÃ©s de Payback, EA y Ghost Games prometieron una vuelta a las raÃ­ces, a la idea de correr por el hecho de pasarlo bien y escapar de la policÃ­a.<br />\r\n<br />\r\nDesechando algunas de las ideas anteriores, se decidiÃ³ volver al origen, a lo bÃ¡sico, y Need for Speed Heat serÃ¡ la culminaciÃ³n de este tipo de promesas y preceptos.<br />\r\n<br />\r\nPor tanto, Ghost Games ha decidido cambiar de planteamiento y diseÃ±o ofreciÃ©ndonos una visita a Palm City, una ciudad enorme llena de ambientes festivos que nos invitarÃ¡ a recorrerla a travÃ©s de competiciones y torneos espectaculares por el dÃ­a y a memorizar sus calles y avenidas por la noche con carreras ilegales mientras intentamos esquivar a la policÃ­a y sus envites.<br />\r\n<br />\r\nEso sÃ­, se mantendrÃ¡ fiel a la tradiciÃ³n de darnos muchos coches y una banda sonora cuidada que, como la iluminaciÃ³n, se adaptarÃ¡ a la hora del dÃ­a.', '2019-11-02 21:56:18', 2);
