(19, 'PS: Call of Duty Modern Warfare fue lo mÃ¡s descargado de octubre de 2019', 'La tienda digital de PlayStation 4 se rinde al tÃ­tulo de acciÃ³n de Activision e Infinity Ward', 'Call Of Duty, PS4', , 'Sony ha anunciado, a travÃ©s de su blog oficial cuÃ¡les han sido los videojuegos mÃ¡s descargados del mes de octubre en PlayStation Store, la tienda digital de PlayStation 4. Pocas sorpresas: Call of Duty: Modern Warfare irrumpe con fuerza en el top y le arrebata el primer puesto a FIFA 20, lÃ­der indiscutible hasta la fecha.<br />\r\n<br />\r\nCall of Duty: Modern Warfare es un Ã©xito sin precedentes para Activision. El nuevo videojuego de acciÃ³n en primera persona, desarrollado por Infinity Ward, logrÃ³ recaudar mÃ¡s de 600 millones de dÃ³lares en su lanzamiento el pasado 25 de octubre, convirtiÃ©ndose en toda una bestia lÃºdica capaz de congregar a mÃ¡s jugadores durante su primer fin de semana que ningÃºn otro juego en los Ãºltimos seis aÃ±os. Las cifras marean ellas solas, demostrÃ¡ndonos el poder de convocatoria. En formato fÃ­sico, segÃºn nos informa GAME, tambiÃ©n ha sido un triunfo para la editora.<br />\r\n<br />\r\nAunque Call of Duty es el Ã©xito mÃ¡s importante del mes, no es la Ãºnica novedad del top. Ghost Recon Breakpoint es la otra novedad de octubre. El shooter tÃ¡ctico de Ubisoft se ha alzado con el cuarto puesto, y aunque la empresa esperaba mÃ¡s de este videojuego segÃºn sus demoledoras declaraciones, su puesto en este listado digital ejemplifica la importancia de la saga para el grueso de jugadores de PlayStation 4. Por otra parte, el videojuego de rol Obsidian, The Outer Worlds, alcanzÃ³ el sÃ©ptimo lugar, mientras que el remake de MediEvil, un clÃ¡sico de PlayStation, se colÃ³ en el noveno puesto. A continuaciÃ³n os dejamos con las listas completas por plataformas -PlayStation 4 y PS VR- asÃ­ como de contenidos descargables y de videojuegos gratuitos.<br />\r\n<br />\r\n', '2019-11-06 16:01:03', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(20, 'Death Stranding: Tendremos libertad en su jugabilidad, pero no en la historia', 'Hideo Kojima seÃ±ala que los jugadores no podrÃ¡n escapar de la hostoria principal', 'Death Stranding, PS4', , 'Hideo Kojima ha intentado encontrar el balance perfecto para Death Stranding en cuanto a la libertad que ofrece al jugador. El desarrollador japonÃ©s ha encontrado la fÃ³rmula perfecta estableciendo lo siguiente: si bien en el mundo del juego podremos ir a donde queramos y hacer lo que nos venga en gana, no podremos escapar de la narrativa. \"Si el personaje estÃ¡ destinado a morir, el jugador no puede evitar eso\", explica Kojima.<br />\r\n<br />\r\n\"Como un juego de acciÃ³n de mundo abierto, puedes ir a cualquier parte, Â¿cierto? Y puedes hacer cualquier cosa\", explica Kojima durante un panel de EGX Berlin (vÃ­a Metal Gear Informer). \"TÃº decides quÃ© hacer. Porque si no puedes, no es realmente divertido, Â¿verdad? Pero en cuanto a la narrativa, la historia misma debe ser como un destino\".<br />\r\n<br />\r\nEn este sentido, Kojima sostiene lo siguiente: \"Si el personaje estÃ¡ destinado a morir, vosotros [los jugadores] no podÃ©is evitar eso. (...) Es un destino. Entonces, en cuanto a la libertad del juego, el destino y el tiempo en que transcurre en la historia... trato de equilibrar ambos mundos. Es difÃ­cil equilibrar, pero creo que hay formas de equilibrar eso realmente\".<br />\r\n<br />\r\nKojima tambiÃ©n detallÃ³ que, aunque en tÃ©rminos de jugabilidad o aspectos tÃ©cnicos estÃ¡ dispuesto a escuchar los comentarios de los jugadores sobre lo que les gusta y lo que deberÃ­a cambiar, el creativo esgrime que la historia y la temÃ¡tica se mantienen inamovibles.<br />\r\n<br />\r\n\"El tema de la historia tengo que sacarlo yo mismo\", indica. \"En los videojuegos, los usuarios realmente controlan lo que va a suponer el juego final. AsÃ­ que tengo que pensar en la interfaz de usuario o en la misma jugabilidad. Entonces, escucho a los usuarios porque los jugadores son parte de eso, y son los que van a tener que jugarlo. AsÃ­ que estoy pendiente, escucho lo que dicen y lo modifico. Pero no la historia. Eso sÃ³lo me concierne a mÃ­\".<br />\r\n<br />\r\nEl mundo de Death Stranding pone sobre la mesa la situaciÃ³n del mundo actual: una sociedad donde las personas estÃ¡n cada vez mÃ¡s conectadas gracias a los avances tecnolÃ³gicos pero, al mismo tiempo, estos son los responsables de que estemos cada vez mÃ¡s separados. Es por eso que Hideo Kojima pretende que Death Stranding sirva para reflexionar sobre cuestiones como el muro de Donald Trump o sobre el Brexit de Reino Unido. \"La era actual se basa en el individualismo\", sostenÃ­a Kojima.', '2019-11-06 16:05:16', 2);

